import React from 'react'

function FeedbackForm() {

    return (
    <div>
        <form>
            <p>How would you rate our service?</p>

            <textarea placeholder='Write a review'></textarea>
            <input type={submit}>Send</input>
        </form>
    </div>
    )
}

export default FeedbackForm
